import React, { Component } from 'react';
import './App.css';
import Button from '@material-ui/core/Button';

class App extends Component {

    render() {
      return (
        <header class="bg-black-90 fixed w-100 ph3 pv3 pv4-ns ph4-m ph5-l">
          <nav class="f6 fw6 ttu tracked">
            <Button class="link dim white dib mr3" href="#" title="Home">Home</Button>
            <Button class="link dim white dib mr3" href="#" title="About">About</Button>
            <Button class="link dim white dib mr3" href="#" title="Work">Work</Button>
            <Button class="link dim white dib" href="#" title="Contact">Contact</Button>
          </nav>
        </header>

        // <div class="flex" >
        //     <Button class="mr4">Home</Button>
        //     <Button class="mr4">About</Button>
        //     <h1 class="mr4">Katie Macaulay</h1>
        //     <Button class="mr4">Work</Button>
        //     <Button class="mr4">Contact</Button>
        // </div>
      );
    }
  }

  export default App;
